from pyprocessing import *
from datetime import *
from random import random


class tweet():
    def __init__(self,tweetlog_entry):
        data = tweetlog_entry.replace('\n','').split('\t')
        self.author_id = data[1]
        self.author_name = data[0]
        self.lat = data[2]
        self.lon = data[3]
        self.timestamp = datetime.strptime(data[4],'%Y-%m-%d %H:%M:%S')
        self.message = data[5]
    def __str__(self):
        return '%s(#%s): %s [%s %s]' % (self.author_name,self.author_id,self.message,self.lat,self.lon)
    def hasGeo(self):
        if self.lat == 'None' or self.lon == 'None':
            return False
        else:
            if self.getLat() == 0 or self.getLon() == 0:
                return False
            return True
    def getLat(self):
        return float(self.lat)
    def getLon(self):
        return float(self.lon)
    def getTimestamp(self):
        return self.timestamp
    def getTimeOffset(self):
        # start is given in UTC+2
        return self.timestamp + timedelta(hours=2) - start # + 2 hours for to align time stamps
    def isInBox(self,box):
        if not self.hasGeo():
            return False
        if self.getLat() > box[1] and self.getLat() < box[3] and self.getLon() > box[0] and self.getLon() < box[2]:
            return True
        else:
            return False

class author():
    def __init__(self,id,name):
        self.id = id
        self.name = name
        self.tweets = []
    def __str__(self):
        return '%s(#%s)' % (self.name,self.id)
    def addTweet(self,tweet):
        if tweet.getTimeOffset() < timedelta(seconds=0) or tweet.getTimeOffset() > timedelta(days=1):
            return
        self.tweets.append(tweet)
    def getTweets(self):
        return self.tweets
    def getNextGeoTweet(self,current_id):
        # returns the next geocoded tweet in the list after current_id
        for i in range(current_id+1,len(self.tweets)):
            if self.tweets[i].hasGeo():
                return self.tweets[i]
        return False
    def tweetsInBox(self,box):
        for t in self.tweets:
            if t.isInBox(box):
                return True
        return False

class Cube():
    def __init__(self,w,h,d):
        self.vertices = [0]*24
        self.w = w;
        self.h = h;
        self.d = d;
        
        # cube composed of 6 quads
        #front
        self.vertices[0] =  PVector(-w/2,-h/2,d/2)
        self.vertices[1] =  PVector(w/2,-h/2,d/2)
        self.vertices[2] =  PVector(w/2,h/2,d/2)
        self.vertices[3] =  PVector(-w/2,h/2,d/2)
        #left
        self.vertices[4] =  PVector(-w/2,-h/2,d/2)
        self.vertices[5] =  PVector(-w/2,-h/2,-d/2)
        self.vertices[6] =  PVector(-w/2,h/2,-d/2)
        self.vertices[7] =  PVector(-w/2,h/2,d/2)
        #right
        self.vertices[8] =  PVector(w/2,-h/2,d/2)
        self.vertices[9] =  PVector(w/2,-h/2,-d/2)
        self.vertices[10] =  PVector(w/2,h/2,-d/2)
        self.vertices[11] =  PVector(w/2,h/2,d/2)
        #back
        self.vertices[12] =  PVector(-w/2,-h/2,-d/2)
        self.vertices[13] =  PVector(w/2,-h/2,-d/2)
        self.vertices[14] =  PVector(w/2,h/2,-d/2)
        self.vertices[15] =  PVector(-w/2,h/2,-d/2)
        #top
        self.vertices[16] =  PVector(-w/2,-h/2,d/2)
        self.vertices[17] =  PVector(-w/2,-h/2,-d/2)
        self.vertices[18] =  PVector(w/2,-h/2,-d/2)
        self.vertices[19] =  PVector(w/2,-h/2,d/2)
        #bottom
        self.vertices[20] =  PVector(-w/2,h/2,d/2)
        self.vertices[21] =  PVector(-w/2,h/2,-d/2)
        self.vertices[22] =  PVector(w/2,h/2,-d/2)
        self.vertices[23] =  PVector(w/2,h/2,d/2)
  
    def create(self,quadBG=None):
        # Draw cube
        for i in range(0,6):
            if quadBG:
                fill(quadBG[i])
            beginShape(QUADS)
            for j in range(0,4):
                vertex(self.vertices[j+4*i].x, self.vertices[j+4*i].y, self.vertices[j+4*i].z)
            endShape()
      
      
def lon2screen(lon):
    return (lon+73.98)*4000
def lat2screen(lat):
    return (lat-40.765)*-4000 # more is forward
def t2screen(t):
    t = t.seconds/86400.0 # 86400 seconds per day
    t = t*bounds
    return bounds/2.0-t
    

